import React, { Component } from 'react';

import { RichText } from 'prismic-reactjs';

let TrackSingle = props => {
	return (
		<li  onClick={() => this.setState({ selectedTrack: 'https://prismic-io.s3.amazonaws.com/heequalsmcsqaured/90dec21a-b627-4ccc-bd1d-0124cf9d447a_Celebration.mp3' })} class={props.trackIndex == 0 && 'tracklist-card__list-active-track'}>
		 	<i className="material-icons" style={{fontSize: '20px'}}>play_arrow</i> <span className="mb-0">{RichText.asText(props.trackName)}</span>
		</li>
	)
}

export default TrackSingle;
